import React from "react";
import { CardStyle } from './styles'

function CardJogador() {
    return (
        <CardStyle>

            <div className="card">

                    <div className="image"><img src="" alt="" /></div>

                    <div className="infos">
                        <p id="nome">Nome:</p>
                        <p id="idade">Idade:</p>
                        <p id="nascionalidade">Nacionalidade:</p>
                        <p id="clube">Clube:</p>
                        <p id="posicao">Posição:</p>
                        <p id="over">Overall:</p>
                    </div>

            </div>

        </CardStyle>

    );
}

export default CardJogador;
